import './workshopProposals.css';
import Swal from "sweetalert2";
import React, { Component} from 'react';
import axios from 'axios';

class WorkshopProposals extends Component {
  constructor(props) {
    super(props);
    this.state = {
      workshopProposal: []

    }
    //this.onEdit = this.onEdit.bind(this);

  }
  componentDidMount(){
    //this.setState({workshopProposal:this.props.match.params.id},this.getworkshopProposal)

    axios.get(`http://localhost:7000/workshopProposal/${this.props.match.params.id}`)
    .then(response => {
      this.setState({workshopProposal: response.data.data});
    })
    .then(() =>{
      console.log(this.state.workshopProposal)
                this.setState({ content: this.state.workshopProposal.content });
                this.setState({ title: this.state.workshopProposal.title });
                this.setState({ venue: this.state.workshopProposal.venue });
                this.setState({ date: this.state.workshopProposal.date });
                this.setState({ organizers: this.state.workshopProposal.organizers });
                this.setState({ duration: this.state.workshopProposal.duration });
                this.setState({ type: this.state.workshopProposal.type });
                this.setState({ status: this.state.workshopProposal.status });
                this.setState({ document: this.state.workshopProposal.document });

    });
  }

  confirmWorkshopProposal(e, workshopProposalId) {
    //this.props.history.push(`/confirm`);
    //this.props.history.push(`/edit/`);
    this.props.history.push({
        pathname: `/confirm/${workshopProposalId}`,
        data:`${workshopProposalId}`
      });
  
  }

/*
  approve(e , workshopProposalId) {
    console.log("Approve", workshopProposalId)
    Swal.fire({
        title: 'Are you sure?',
        text: "You want to approve it!",
        icon: 'warning',
        showCancelButton: true,
        confirmButtonColor: '#3085d6',
        cancelButtonColor: '#d33',
        confirmButtonText: 'Yes, approve it!'
    }).then((result) => {
        if (result.isConfirmed) {
            //axios.patch(`http://localhost:7000/workshopProposal/${workshopProposalId}`)
            Swal.fire(
                'Approved!',
                'Workshop Proposal has been appproved.',
                'success'
            )
        }
    })
}*/
/*
decline(e , workshopProposalId) {
    console.log("Approve", workshopProposalId)
    Swal.fire({
        title: 'Are you sure?',
        text: "You want to decline it!",
        icon: 'warning',
        showCancelButton: true,
        confirmButtonColor: '#3085d6',
        cancelButtonColor: '#d33',
        confirmButtonText: 'Yes, decline it!'
    }).then((result) => {
        if (result.isConfirmed) {
            axios.post(`http://localhost:7000/approveWorkshopProposal/create`)
            Swal.fire(
                'Declined!',
                'Workshop Proposal has been declined.',
                'unsuccess'
            )
        }
    })
}
*/


  render(){
    return (
      
     /* <div className = "container">
        <br/>
      <h1>Details</h1>
      
          <div className="p-3">
            <h4>Content: {this.state.content}</h4>
            <h5>Title: {this.state.title}</h5>
            <h5>Venue: {this.state.venue}</h5>
            <h5>Date: {this.state.date}</h5>
            <h5>Organizers: {this.state.organizers}</h5>
            <h5>Duration: {this.state.duration}</h5>
            <h5>Status: {this.state.status}</h5>
            <h5>Document: {this.state.document}</h5>
          </div>
          <button type="button" className="btn btn-primary"  onClick={e => this.approve(e, item._id)} >Approve</button>
          <button type="button" className="btn btn-danger"  onClick={e => this.decline(e, item._id)} >Decline</button>
        </div>
        */

        <div className="container"><br/>
            <div className={"card p-4"}>
            
                <h5 htmlFor="content"  className="form-label mb-4" style={{textAlign:"left"}}>
                    {}
                </h5>

                <form onSubmit={this.onSubmit} onChange={this.onHandle}>
                
                    <div className={"row"}>
                        <div className={"col-md-6"}>
                            <div className="mb-3" style={{textAlign:"left"}}>
                                <label htmlFor="title"  className="form-label">Content</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    id="content"
                                    name="content"
                                    value={this.state.content}
                                    onChange={this.onChange}
                                />
                            </div>
                            <div className="mb-3" style={{textAlign:"left"}}>
                                <label htmlFor="title"  className="form-label">Title</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    id="title"
                                    name="title"
                                    value={this.state.title}
                                    onChange={this.onChange}
                                />
                            </div>
                            <div className="mb-3" style={{textAlign:"left"}}>
                                <label htmlFor="venue"  className="form-label">Venue</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    id="venue"
                                    name="venue"
                                    value={this.state.venue}
                                    onChange={this.onChange}
                                />
                            </div>
                            <div className="mb-3" style={{textAlign:"left"}}>
                                <label htmlFor="date"  className="form-label">Date</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    id="date"
                                    name="date"
                                    value={this.state.date}
                                    onChange={this.onChange}
                                />
                            </div>
                            <div className="mb-3" style={{textAlign:"left"}}>
                                <label htmlFor="organizers"  className="form-label">Organizers</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    id="organizers"
                                    name="organizers"
                                    value={this.state.organizers}
                                    onChange={this.onChange}
                                />
                            </div>
                            <div className="mb-3" style={{textAlign:"left"}}>
                                <label htmlFor="duration"  className="form-label">Duration</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    id="duration"
                                    name="duration"
                                    value={this.state.duration}
                                    onChange={this.onChange}
                                />
                            </div>
                            <div className="mb-3" style={{textAlign:"left"}}>
                                <label htmlFor="type"  className="form-label">Type</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    id="type"
                                    name="type"
                                    value={this.state.type}
                                    onChange={this.onChange}
                                />
                            </div>
                            <div className="mb-3" style={{textAlign:"left"}}>
                                <label htmlFor="status"  className="form-label">Status</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    id="status"
                                    name="status"
                                    value={this.state.status}
                                    onChange={this.onChange}
                                />
                            </div>
                            <div className="mb-3" style={{textAlign:"left"}}>
                                <label htmlFor="document"  className="form-label">Document</label>
                                <input
                                    type="text"
                                    className="form-control"
                                    id="document"
                                    name="document"
                                    value={this.state.document}
                                    onChange={this.onChange}
                                />
                            </div>
                            
                            <button type="button" className="btn btn-success"  onClick={e => this.confirmWorkshopProposal(e,this.props.match.params.id)} >Approve / Decline</button>
                            
    
                            </div>
                            </div>
                            <br>
                            </br>
                            <br></br>
                            <br></br>
                            </form>
                        
                            </div>
                            </div>
    )
  }                         
}


export default WorkshopProposals;
